import React from "react";
import "../../../Styles/Pages/Home/LandingSecond.scss";
import PayingSimple from "../../Shared/PayingSimple";
import { list1, list2 } from "./payingList";

function LandingSecond() {
  return (
    <div className='landingSecond'>
      <div className='landingSec__title'>
        <h2>Make Paying Simple</h2>
        <p>
          Reduce barriers to purchase your product or service with our variety
          of payment features.
        </p>
      </div>
      <div className='landingSec__row'>
        {list1.map((item, key) => {
          return (
            <PayingSimple
              img={item.img}
              title={item.title}
              paragraf={item.paragraf}
              key={key}
            />
          );
        })}
      </div>
      <div className='landingSec__row'>
        {list2.map((item, key) => {
          return (
            <PayingSimple
              img={item.img}
              title={item.title}
              paragraf={item.paragraf}
              key={key}
            />
          );
        })}
      </div>
    </div>
  );
}

export default LandingSecond;
